                        "question": "</span></p>  <p><span>TEXTE DE COMPREHENSION</span></p> <p><span>Lisez le texte et répondez à la question qui suit.</span></p>  <p><span><b>Texte 1</b></span></p> <p><span><b>Le grand magasin de la ville</b></span></p> <p><span>Dans un grand bâtiment est installé ce grand magasin de la ville. Il y a les arcades qui le bordent et qui permettent de circuler sans se mouiller quand il pleut. Le panneau en haut devant le toit à la rentrée porte le nom ‘grand magasin de la ville’. Il est bien distingué sur la rue du 2</span><sup><span>e</span></sup><span> avenue. Arrivée devant le magasin énorme, les devantures plongent les clients dans l’admiration. Tant elles renferment de belles choses arrangées avec goût. Il est ouvert de 7h30 à 22heures.</span></p> <p><span>D’élégantes toilettes étaient portées par des mannequins aux figures de cire, qui tournaient pour se montrer sous toutes leurs faces. Une fille qui était dans le magasin avec sa mère les admirait. Plus loin des parapluies ou de divers sacs de dames à un côté, l’autre côté des cravates, des vestes et des pantalons d’hommes étaient assortis. </span> </p> <p><span>Il y avait une vitrine garnie seulement des mouchoirs roses et des écharpes de différentes couleurs.</span></p> <p><span>L’on aurait envie de tout acheter tant l’arrangement des marchandises à l’intérieur était formidable. Il y avait du monde qui entrait dans le magasin. La foule se pressait. C’était surtout les femmes. On passait d’une galerie à l’autre. On pouvait voir une petite fille qui s’intéressait à la section des poupées.</span></p> <p><span>On ne peut pas conclure cette description de ce grand magasin sans mentionner l’atelier de photographie et le restaurant. </span> </p> <p><span>Adaptée de</span><span><i>: Les lectures vivantes, Cours moyens et classe de septième des écoles africaines,</i></span><span><i><u> </u></i></span><span>Librairie Istra, Paris</span></p>",
