                        "question": "</span></p>   <p><span>TEXTE DE COMPREHENSION</span></p> <p><span>Lisez le texte et répondez à la question qui suit.</span></p>  <p><span>TEXTE 1</span></p> <p><span><b>L’ELEVE MECHANT</b></span></p> <p><span>Il était une fois un petit garçon qui s’appelait Tunde. Il était si petit et si maigre que les autres élèves disaient qu’il n’avait pas d’estomac. A cause de sa petite taille, il était battu par les grands garçons de l’école, et ceci le rendait malheureux. Parmi ces garçons, le plus méchant était Badou. Il cherchait toujours l’occasion de frapper le petit Tunde.</span></p> <p><span>Un jour, Tunde appela son ami, Konte et lui dit:</span></p> <p>‘<span>J’en ai assez d’être battu. J’en ai assez! Je le dirai à mon père.’</span></p> <p>‘<span>Sois tranquille,’ lui répondit Konte. ‘Cela ne servira à rien. Ces grands garçons sont très méchants.’</span></p> <p><span>Le lendemain, Tunde appela Badou, le plus méchant des garçons, et lui dit que son père voulait rencontrer son meilleur ami. Donc, il l’invitait à manger chez eux le soir. Badou, qui était aussi stupide que brutal, accepta cette invitation avec plaisir.</span></p> <p><span>Le soir, à l’heure fixée, Badou se présenta chez Tunde. Le père de Tunde ouvrit la porte et, Badou entra, la referma soigneusement. Badou attendait un bon repas et des compliments, mais Tunde se leva brusquement et dit à son père:</span></p> <p>‘<span>Père, voici le grand qui ne cesse de me frapper à l’école.’ Très surpris,Badou essaya de se sauver mais la porte était fermée à clé. Badou fut tellement battu qu’il ne pouvait plus rentrer chez lui ce soir-là.</span></p> <p><span>Après ce jour-là, personne ne frappa plus Tunde.</span></p>  <p>Adapt<span>é</span>e de: <i>Introduction to Practice in Oral French, </i> Tunde Ajiboye, 2012, p. 31</p>",
