                        "question": "<p> <b>Passage I</b></p> <p> <b>Read the passage carefully and answer the question that follows. </b> </p>  <p> You need to travel by rail to admire the scenery that only rail-travel can offer. Although rail network is not well developed in a country like Nigeria, you will enjoy seeing natural features such as mountains, valleys, rivers and forests when travelling on a train. Trains run on tracks with rails. The rails rest on sleepers (heavy beams of concrete, steel or wood on which the rails of a railway are fixed). A sleeper is also used to refer either to a night train with sleeping accommodation on it or to a bed on such a train. The former is also called a sleeping car.</p> <p> The movement of trains is also controlled by signals. Steam diesel and electronic locomotives power them. Steam locomotives have been phased out because of its relative low speed. There are commuter trains as well as freight trains. Commuter trains are usually in coaches and may include sleepers and buffet car for light meals. Such coaches are in compartments with bunks. Freight trains consist of trucks which are used for carrying goods and animals. A device called buffer reduces the effect of the coaches and trucks knocking one another.</p> <p> You need to obtain a ticket at the railway station if you want to travel by train. You may pay for a first-class compartment if you wish to enjoy maximum comfort. A second-class ticket is however cheaper. You will then be shown the platform of your train. A platform is a flat surface built next to and at a higher level than a railway track where passengers get on and off trains.</p>  <p> Adapted from <i>Catch Up English Language</i> HEBN Publishers</p>",
