                        "question": "<p>Àkàyé I</p> <p>Ka àyọkà yìí, kí o sì dáhùn ìbéèrè tí ó tẹ̀lé e.</p>  <p>Onírúurú ìtàn ìṣẹ̀dálẹ̀ ilé ayé ni a ti gbọ́ rí, àwọn onígbàgbọ́ ní ọgbà ídẹ́nì layé ti bẹ̀rẹ̀, wọ́n ní Ọlọ́run ló dá ayé àti ọ̀run àti pé ibi àkọ́kọ́ tí ẹ̀dá gbé ni ọgbà ídẹ́nì, tí wọ́n pè ní ọgbà ìdẹ̀ra, wọ́n jẹ́ kí a mọ̀ pé onírúurú igi eléso ni ó pọ̀ ní ọgbà náà. Olúwa dá Ádámù àti Ééfà sínú ọgbà pé kí wọn ó máa gbádùn, nígbà tí ìgbádùn pọ̀ tán, wọ́n ṣàìgbọràn jèso ayé, èyí tó fà á tí Olúwa fi lé wọn dà síta ni wàhálà bá bẹ̀rẹ̀.</p> <p>Àwọn onísáyẹ́ǹsì kò gba àlàyé òkè yìí gbọ́, ọ̀tọ̀ ni ojú tí àwọn fi wò ó, àwọn gbà pé ènìyàn kọ́ ló dá ayé, ayé wà bó ṣe wà ni. Wọ́n ní kiní kan rìbìtì tó dà bí i bọ́ọ̀lù ló bú gbàmù tó fọ́ wẹ́wẹ́, nígbà tó tutù ló bá di onírúurú ayé rírí àti àìrí. Ọ̀kan lára ọ̀nà tí wọ́n ní nǹkan rìbìtì náà fọ́ sí ló di ayé èyí tí a wà yìí. Àwọn ayé mìíràn tí wọ́n tún ní ó wà ni Fẹ́nọ́ọ̀sì, Máàsì, Júpítà, Sàtúùmì àti bẹ́ẹ̀ bẹ́ẹ̀ lọ. </p> <p>Ìgbàgbọ́ Yorùbá nipa ìṣẹ̀dá yàtọ̀ gédéńgbé, ojú tí àwọn fi wò ó yàtọ̀ gédégbé. Àwọn Yorùbá gbà pé Olódùmarè ni olùṣẹ̀dá ayé àti ọ̀run. Ó wá rán ọ̀kan nínú àwọn àgbà òrìṣà tí í ṣe Ọ̀rúnmìlà pé kí ó wá tẹ ilé ayé dó sí orí omi. Olódùmarè fún un ní èkùrọ́, yẹ̀pẹ̀ nínú ìkarahun ìgbín àti adìyẹ kan. Ó ní bí ó bá ti dé ilé ayé kí ó da yẹ̀pẹ̀ sí orí omi, kí ó sì tú adìyẹ sílẹ̀ láti tan yẹ̀pẹ̀ náà. Bí adìyẹ ti ń tan yẹ̀pẹ̀ náà ló ń fẹ̀, níbi tí orúkọ Ilé-Ifẹ̀ ti jáde.</p>",
